import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import axios from 'axios';
import 'leaflet/dist/leaflet.css';

const Dashboard = () => {
  const [parkingSpots, setParkingSpots] = useState([]);

  useEffect(() => {
    const fetchSpots = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/parking');
        setParkingSpots(res.data);
      } catch (err) {
        console.error('Error fetching parking spots:', err);
      }
    };

    fetchSpots();
  }, []);

  const handleBook = async (id) => {
    try {
      await axios.post('http://localhost:5000/api/bookings', { spotId: id });
      alert('Spot booked!');
      // Refresh list
      const res = await axios.get('http://localhost:5000/api/parking');
      setParkingSpots(res.data);
    } catch (err) {
      alert('Booking failed');
    }
  };

  return (
    <div>
      <h2>Nearby Parking Spots</h2>
      <MapContainer center={[28.6139, 77.209]} zoom={12} style={{ height: '500px', width: '100%' }}>
        <TileLayer
          attribution='&copy; OpenStreetMap contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        {parkingSpots.map((spot, idx) => (
          <Marker key={idx} position={[spot.latitude, spot.longitude]}>
            <Popup>
              <b>{spot.name}</b><br />
              Status: {spot.isAvailable ? '✅ Available' : '❌ Occupied'}<br />
              {spot.isAvailable && (
                <button onClick={() => handleBook(spot._id)}>Book Now</button>
              )}
            </Popup>
          </Marker>
        ))}
      </MapContainer>
    </div>
  );
};

export default Dashboard;
